  false,\n\t\"url\": null,\n\t\"notes\": \"BEDROCK_REGIONAL_GEOLOGIC_MAP1_IGS_IN.TIF
  is a georeferenced TIFF image that shows bedrock geology of the 1 x 2 Indianapolis
  quadrangle in the states of Indiana and Illinois at a scale of 1:250,000. The mapped
  stratigraphic units include systems and selected groups, formations, and other stratigraphic
  units, contacts, quarried lands, and made and modified lands. This resource is available
  online as a web map service, an ESRI service, and as a downloadable file. Downloadable
  (zipped) compressed folder contains the BEDROCK_REGIONAL_GEOLOGIC_MAP1_IGS_IN.TIF
  image and metadata. For more information see links provided.\",\n\t\"license_title\":
